import './TransactionBubble.css';

function TransactionBubble() {
    return (
        <div className='absolute top-5 left-15 w-64 h-64'>
            <div
            className={`bubble
            w-64 h-64
            bg-coolgray50 drop-shadow-sm rounded-full flex place-items-center justify-center`}>
                <h1>Bubble</h1>
            </div>
        </div>
    );
}

export default TransactionBubble;
